class FFBPNetwork:
    """pull everything together into a fully functioning FFBPNetwork class
        that is accessible to client"""
    class EmptyLayerException(Exception):
            pass

    class EmptySetException(Exception):
            pass

    def __init__(self, num_inputs, num_outputs):
        self.layers = LayerList(num_inputs, num_outputs)

    def add_hidden_layer(self, num_neurodes=5):
        if num_neurodes < 1:
            raise FFBPNetwork.EmptyLayerException

        self.layers.insert_hidden_layer(num_neurodes)

    def remove_hidden_layer(self):
        self.layers.remove_hidden_layer()

    def iterate(self):
        self.layers.iterate()

    def rev_iterate(self):
        self.layers.rev_iterate()

    def reset_cur(self):
        self.layers.reset_cur()

    def get_layer_info(self):
        self.layers.current.get_layer_info()

    def train(self, data_set: NNData, epochs=1000,
              verbosity=0, order=NNData.Order.SEQUENTIAL):
        """train the data"""
        if data_set is None:
            raise FFBPNetwork.EmptySetException

        list_rmse = []
        for _ in range(epochs):
            sum_delta = 0
            data_set.prime_data(None, order)
            while data_set.empty_pool() is False:
                list_x_y = data_set.get_one_item()
                x = list_x_y[0]
                y = list_x_y[1]

                inputs = self.layers.get_input_nodes()
                for i, node in enumerate(inputs):
                    input_value = x[i]
                    node.receive_input(None, input_value)

                outputs = self.layers.get_output_nodes()
                list_value = []
                for i, node in enumerate(outputs):
                    output_value = node.get_value()
                    node.receive_back_input(None, y[i])
                    error = (y[i] - output_value)**2
                    sum_delta += error
                    list_value.append(output_value)

                chunk_value = [list_value[x:x + len(y)] for x in range(0, len(list_value), len(y))]
                [chunk_value] = chunk_value
                if verbosity > 1 and _ % 1000 == 0:
                    print("predicted value:", chunk_value, "expected value:", y)

            rmse = math.sqrt(sum_delta / data_set.get_number_samples(None))
            list_rmse.append(rmse)

            if verbosity > 0:
                if _ % 100 == 0:
                    print("RMSE=", rmse)
            elif verbosity == 0:
                pass

        print("RMSE in the last epoch = ", list_rmse[-1])

    def test(self, data_set: NNData, order=NNData.Order.SEQUENTIAL):
        """confirm the data can work"""
        if data_set is None:
            raise FFBPNetwork.EmptySetException
        sum_delta = 0
        data_set.prime_data(NNData.Set.TEST, order)
        while data_set.empty_pool(NNData.Set.TEST) is False:
            list_x_y = data_set.get_one_item(NNData.Set.TEST)
            x = list_x_y[0]
            y = list_x_y[1]

            inputs = self.layers.get_input_nodes()
            for i, node in enumerate(inputs):
                input_value = x[i]
                node.receive_input(None, input_value)

            outputs = self.layers.get_output_nodes()
            list_predicted_value = []
            for i, node in enumerate(outputs):
                output_value = node.get_value()
                node.receive_back_input(None, y[i])
                error = (y[i] - output_value) ** 2
                sum_delta += error
                list_predicted_value.append(output_value)

            chunk_value_output = [list_predicted_value[x:x + len(y)]
                                  for x in range(0, len(list_predicted_value), len(y))]
            [chunk_value_output] = chunk_value_output

            print("input:", x, "expected value:", y, "predicted value:", chunk_value_output)

        rmse = math.sqrt(sum_delta / data_set.get_number_samples(None))
        print("RMSE=", rmse)


